svg.script:


var t1 = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 0
    });

var t2 = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 0,
        onStart: function(){
            gsap.set("#left-bar1", {scaleX:0.33});
        }
    });
var t3 = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 0,
        onStart: function(){
            gsap.set("#left-bar2", {scaleX:0.1});
        }
    });

t2.add(
        gsap.fromTo(
                    "#left-bar1",
                            {
                                scaleX:0.33,
                                delay: 5,
                                duration:2,
                                transformOrigin:"left",

                            },
                            {
                                scaleX:1,
                                delay: 5,
                                duration: 2,
                                ease:Linear.easeNone
                            }
                    )
        );

t2.add(
        gsap.fromTo(
                    "#left-bar1",
                            {
                                scaleX:1,
                                delay: 5,
                                transformOrigin:"left",
                            },
                            {
                                scaleX:0.33,
                                delay: 5,
                                duration: 2,
                                ease:Linear.easeNone
                            }
                    )
        );

t3.add(
        gsap.fromTo(
                    "#left-bar2",
                            {
                                scaleX:0.1,
                                delay: 5,
                                duration:2,
                                transformOrigin:"left",

                            },
                            {
                                scaleX:1,
                                delay: 5,
                                duration: 2,
                                ease:Linear.easeNone
                            }
                    )
        );

t3.add(
        gsap.fromTo(
                    "#left-bar2",
                            {
                                scaleX:1,
                                delay: 5,
                                transformOrigin:"left",
                            },
                            {
                                scaleX:0.1,
                                delay: 5,
                                duration: 2,
                                ease:Linear.easeNone
                            }
                    )
        );
t1.add(
        gsap.to(
                    "#stepTwo-rotate",
                            {
                                rotation:360,
                                delay: 0,
                                duration:12,
                                transformOrigin:"47% 53%",
                                ease:Linear.easeNone    
                            }
                    )
        );
